

  <tr>
  <td>Player Name</td>
  <td>
  <input required name='name'  class='minegcgforminput' list='name_html' id='name_input' 
    onkeypress=
    "
      (function (event)
      {
        if (event.keyCode == 13)
        {
          
          var input = document.getElementById('name_input');
          var options = Array.from(document.getElementById('name_html').options).map(function(el)
          {
            return el.value;
          }); 
          var relevantOptions = options.filter
          (
            function(option)
            {
              return option.toLowerCase().includes(input.value.toLowerCase());
            }
          );
          if (relevantOptions.length > 0 && input.value != relevantOptions[0])
          {
            input.value = relevantOptions.shift();
	    event.preventDefault();
          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)
    "
>

          var input = document.getElementById('tournament-id_input');
          var options = Array.from(document.getElementById('tournament-id_html').options).map(function(el)
          {
            return el.value;
          }); 
          var relevantOptions = options.filter
          (
            function(option)
            {
              return option.toLowerCase().includes(input.value.toLowerCase());
            }
          );
          if (relevantOptions.length > 0 && input.value != relevantOptions[0])
          {
            input.value = relevantOptions.shift();
	    event.preventDefault();
          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)

  <input  name='game-id'  class='minegcgforminput' list='game-id_html' id='game-id_input' 
    onkeypress=
    "
      (function (event)
      {
        if (event.keyCode == 13)
        {
          
          var input = document.getElementById('game-id_input');
          var options = Array.from(document.getElementById('game-id_html').options).map(function(el)
          {
            return el.value;
          }); 
          var relevantOptions = options.filter
          (
            function(option)
            {
              return option.toLowerCase().includes(input.value.toLowerCase());
            }
          );
          if (relevantOptions.length > 0 && input.value != relevantOptions[0])
          {
            input.value = relevantOptions.shift();
	    event.preventDefault();
          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)
    "

  <input  name='opponent'  class='minegcgforminput' list='opponent_html' id='opponent_input' 
    onkeypress=
    "
      (function (event)
      {
        if (event.keyCode == 13)
        {
          
          var input = document.getElementById('opponent_input');
          var options = Array.from(document.getElementById('opponent_html').options).map(function(el)
          {
            return el.value;
          }); 
          var relevantOptions = options.filter
          (
            function(option)
            {
              return option.toLowerCase().includes(input.value.toLowerCase());
            }
          );
          if (relevantOptions.length > 0 && input.value != relevantOptions[0])
          {
            input.value = relevantOptions.shift();
	    event.preventDefault();
          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)
    "

  <td>
  <input  name='start-date'  class='minegcgforminput' list='start-date_html' id='start-date_input' 
    onkeypress=
    "
      (function (event)
      {
        if (event.keyCode == 13)
        {
          
          var input = document.getElementById('start-date_input');
          var options = Array.from(document.getElementById('start-date_html').options).map(function(el)
          {
            return el.value;
          }); 
          var relevantOptions = options.filter
          (
            function(option)
            {
              return option.toLowerCase().includes(input.value.toLowerCase());
            }
          );
          if (relevantOptions.length > 0 && input.value != relevantOptions[0])
          {
            input.value = relevantOptions.shift();
	    event.preventDefault();
          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)
    "

          {
            input.value = relevantOptions.shift();

          }
          else if (relevantOptions.length == 0)
          {
            alert('Choose an option by typing in the box and selecting an option from the dropdown menu.');
	    event.preventDefault();
          }

        }
      })(event)
